const Semantic = (props) => {
    return (
        props.tags.forEach(arrTag=>{
            let word = arrTag[0];
            let clasification = arrTag[1];
            <div>
                <p>{word}: {clasification}</p>
            </div>
        })
    )
}

export default Semantic;
